import React from 'react';
import './css/TodoCss.css';
type TodoPorps = {
  form: string;
  todo: string;
}
const Todo: React.FC<TodoPorps> = ({form, todo}) => {
  return(
    <div>
    <main className='todo-list'>
      <div className='title'>
      오늘 할 일
      </div>
      <div className="list">
        <section className='forms'>
          {form}
        </section>

        <section className='todos'>
          {todo}
        </section>
      </div>
    </main>
    </div>
  )
};

export default Todo;
